  height: 6vh;
  border-radius: 10px;
  float: right;
  border: 1px solid black;

  font-size: 15px;
  margin-right: 40px;
  margin-top: 20px;

  background: #b8c1ec;
  /* color: #232946; */
  cursor: pointer;

  box-shadow: 4px 4px black;
}


#contact-provider {
  width: 12%;
  height: 6vh;
  float: left;
  border: 1px solid black;
  font-size: 15px;

  margin-left: 40px;
  margin-top: 20px;

  background: #eebbc3;
  box-shadow: 4px 4px black;
  border-radius: 10px;
  cursor: pointer;

}

/* /////////////////////
        MAIN
///////////////////// */

#main #header {
  font-size: 45px;
  margin-left: 10%;
  margin-top: 7vh;
  width: 90%;
  font-family: "Merriweather", serif;
  color: #232946;
}

#main #input {
  width: 55%;
  background: #fffffe;
  height: 50vh;
  float: right;
  margin-right: 100px;
  position: relative;
  top: 3vh;

  border-radius: 35px;
  border: 3px solid #ffc354;
  box-shadow: 15px 15px #b8c1ec;
}

#main input {
  width: 75%;
  position: relative;
  top: 8vh;
  margin-bottom: 4vh;
  height: 35px;
  border-radius: 3px;
  border: 2px solid #232946;
  padding-left: 10px;
  font-size: 16px;
}

#dropdown {
  top: 23.5vh;
  right: 9.5%;
  position: absolute;
  border-radius: 3px;
  z-index: 10;
  max-height: 33vh;
  overflow: auto;
  /* display: none; */
}

/* Dropdown Content (Hidden by Default) */
.dropdown-content {
  display: none;
  background-color: #f6f6f6;
  border: 1px solid #ddd;
  z-index: 1;
  width: 80.8%;
}

/* Links inside the dropdown */
.dropdown-content a {
  color: black;
  padding: 12px 16px;
  text-decoration: none;
  position: relative;
  cursor: pointer;
  text-align: left;
  font-family: "Work Sans", sans-serif;
}

/* Change color of dropdown links on hover */
.dropdown-content a:hover {background-color: #f1f1f1;}

/* Show the dropdown menu (use JS to add this class to the .dropdown-content container when the user clicks on the dropdown button) */
.show {display:block;}

#main #search {
  position: relative;
  top: 15vh;
  width: 82%;
  height: 40px;
  border-radius: 3px;
  border: 2px solid black;
  cursor: pointer;

  background: #5fb4b7;
  color: #153031;
  font-size: 17px;
  transition: all 1s ease-in-out;
  font-family: "Space Grotesk", sans-serif;
}

#main #search:hover {
  border: 3px dotted black;
  transition: all 0.5s ease-in-out;
}

/* /////////////////////
        CHATBOT
///////////////////// */

#chatbox {
    position: fixed;
    bottom: 0;
    height: 50%;
    right: 30px;
    width: 20%;
    background-color: #fff;
    box-shadow: 0 0 10px rgba(0,0,0,0.2);
    border-radius: 8px 8px 0 0;
    overflow: hidden;
    font-size: 14px;
    z-index: 100;
    display: none;
}

.chatbox-header {
    background-color: #4CAF50;
    color: #fff;
    padding: 10px;
    position: relative;
}

.close-btn {
    position: absolute;
    top: 10px;
    right: 10px;
    border: none;
    background: none;
    color: white;
    cursor: pointer;
}

.chatbox-messages {
    height: 200px;
    overflow-y: auto;
    padding: 10px;
    background: #f9f9f9;
}

.message {
    margin-bottom: 15px;
}

.agent, .guest {
    display: flex;
    align-items: flex-start;
}

.agent-img {
    width: 40px;
    height: 40px;
    border-radius: 50%;
    margin-right: 10px;
}

.name {
    font-weight: bold;
}

.agent .text, .guest {
    background-color: #e7e7e7;
    padding: 10px;
    border-radius: 4px;
}

.guest {
    background-color: #d1edc1;
    align-self: flex-end;
