    color: black;
    border: none;
    width: 55%;
    padding: 10px 20px;
    text-align: center;
    text-decoration: none;
    display: inline-block;
    font-size: 16px;
    margin-bottom: 30px;
    cursor: pointer;
    border-radius: 4px;
    font-family: "Space Grotesk", sans-serif;
