/* /////////////////////
    MAKE APPOINTMENT
///////////////////// */

#appointment #user-data {
  width: 30%;
  margin-left: 13vw;
  float: left;
  font-family: "Work Sans", sans-serif;
}

#appointment .user-data-input {
  width: 75%;
  height: 40px;
  margin-top: 30px;
  border: 2.5px solid black;
  border-radius: 10px;
  padding-left: 10px;

  font-weight: 550;
  user-select: none;
  font-size: 16px;

  outline: none;
  transition: all .3s ease-in-out;
}

#appointment .user-data-input:focus {
  box-shadow: 3px 3px #232946;
}

