  float: right;
  margin-right: 8vw;

  width: 40%;
  font-family: "Work Sans", sans-serif;
}

#appointment .appointment-header {
  font-size: 18px;
}

#appointment-availability .appointment-date-first {
  margin-top: -2px;
}

#appointment-availability .appointment-date {
  margin-top: 25px;
}

#appointment-availability .appointment-input-first {
  width: 100%;
  height: 35px;
  cursor: pointer;

  /* top-left | top-right | bottom-right | bottom-left */
  border-radius: 4px 4px 0 0;
  border: 2px solid black;

  border-bottom: none;
  background-color: white;
  text-align: left;

  font-size: 18px;
  margin-top: 15px;
  padding-top: 10px;
  padding-left: 10px;

}

#appointment-availability .appointment-input {
  width: 100%;
  height: 35px;
  cursor: pointer;

  /* top-left | top-right | bottom-right | bottom-left */
  border-radius: 0 0 4px 4px;
  border: 2px solid black;

  background-color: white;
  text-align: left;

  font-size: 18px;
  /* margin-top: 5px; */
  padding-top: 10px;
  padding-left: 10px;
}

#appointment #book-btn {
  width: 20%;
  height: 35px;

  position: relative;
  top: 15vh;

  border: 1px solid black;
  border-radius: 8px;
  cursor: pointer;
  background: #ffd87d;

}
